import React from 'react';
import logo from '../img/logo.webp';

export default function Navbar() {
  return (
    <div className='navbar'>
        <img src={logo} alt=''/>

        <ul className='nav-menu'>
          <li>SignUp</li>
          <li>SignIn</li>
          <li>Portfolio</li>
        </ul>
    </div>
  );
}
